import React from 'react'
import './leaderboard.css'
import { useNavigate } from 'react-router-dom'


const Leaderboards = () => {

  //api call for easy, medium, hard, and extreme games difficulties
  const [savedTimes, setSavedTimes] = React.useState([
    {
      dif: 'hard',
      time: 5000,
      user: 'kyle'
    },
    {
      dif: 'hard',
      time: 5500,
      user: 'john'
    },
    {
      dif: 'hard',
      time: 7000,
      user: 'phil'
    },
    {
      dif: 'hard',
      time: 5000,
      user: 'kyle'
    },
    {
      dif: 'hard',
      time: 5500,
      user: 'john'
    },
    {
      dif: 'hard',
      time: 7000,
      user: 'phil'
    },


  ])
  const navigate = useNavigate()

  //Event functions
  const goBack = () => {
    navigate('/');
  }

  const handleClick = async (e) => {
    const res = await fetch(`blahblah/api/leaderboards?${e.target.value}`);
    const json = await res.JSON();

    setSavedTimes(json)
  }

  const tableData = savedTimes.map((match,index) => {
    return (
      <tr className="table-row" key={match.id}>
        <td>{index+1}</td>
        <td>{match.user}</td>
        <td>{match.dif}</td>
        <td>
          <span>{("0" + Math.floor((match.time / 60000) % 60)).slice(-2)}:</span>
          <span>{("0" + Math.floor((match.time / 1000) % 60)).slice(-2)}:</span>
          <span>{("0" + ((match.time / 10) % 100)).slice(-2)}</span>
        </td>
      </tr>
    )
  })


  return (
    <div className="leaderboards">
      <div onClick={goBack} className="back">&#8592; Back</div>
      <h1>Leaderboards</h1>
      <div className="leaderboard-filter">
        <select>
        </select>
        <button onClick={handleClick} value="easy">Easy</button>
        <button onClick={handleClick} value="medium">Medium</button>
        <button onClick={handleClick} value="hard">Hard</button>
        <button onClick={handleClick} value="extreme">Extreme</button>
      </div>
      <div className="table-container">
        <table className="best-game-table">
          <thead>
            <tr>
              <th>Rank</th>
              <th>Name</th>
              <th>Difficulty</th>
              <th>Time</th>
            </tr>
          </thead>
          <tbody>{tableData}</tbody>
        </table>
      </div>

    </div>
  )
}

export default Leaderboards;
